  false,\n\t\"url\": null,\n\t\"notes\": \"This project is a cooperative effort between
  the National Ocean Service, National Centers for Coastal Ocean Science, Center for
  Coastal Monitoring and Assessment, the University of Hawaii, BAE Systems Spectral
  Solutions and Analytical Laboratories of Hawaii, LLC. The goal of the work was to
  incorporate previously developed mapping methods to produce coral reef habitat maps
  for the Main Eight Hawaiian Islands. GPS field observations were used to establish
  the thematic accuracy of this thematic product. 638 benthic habitat characterizations
  were completed in UTM Zone 4 for this work.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
